         public static void bubblesort(int[] a) {
                  for (int i = 0; i < a.length - 1; i++) {
                           for (int j = 0; j < a.length - i - 1; j++) {
                                    if (a[j] > a[j + 1]) {
                                             a = swap(a, j, j + 1);
                                    }
                           }
                  }
         }

         private static int[] swap(int[] a, int i, int j) {
                  int temp = a[i];
                  a[i] = a[j];
                  a[j] = temp;
                  return a;
         }

